@Joaquin Sanchez Fernandez ¿Pero no decías que no me ibas a nombras más?. Veo que no solo lo vuelves a hacer.. Si no que encima para insultarme. Pues aquí pongo uno de tus sabios comentarios para que sepan lo sabio que eres. 😉

@kaisen muy bien, esa es tu version, yo te digo otra igual de valida, segun el protocolo de sanidad en este país, a vacunados con una y dos dosis los cuentan como no vacunados, y no solo eso, si indaga tb veras otro dato interesante dicho por politicos y medios de comunicación, y es que si ingresa al hospital alguien atropeyado o con sintomas de otra enfermedad diferente al covid, les hacen un test de covid aunque no proceda, y lo añaden a los numeros. Por no mencionar, que un test de porqueria de esos, que dicen que es efectivo en un 90 por ciento, pero que es mucho menor el indice de efectividad y que la mayoria de la gente reporta que son una locura que un dia da positivo y otro no... que da positivo con virus de influenza normal porque la química de unos coronavirus y otros es similar...que da positivos locos con agua del grifo xD pues los datos de los medios son cada vez menos de fiar.

Creo que aparte de no saber ni de lo que hablas como ya te explique con hechos, encima quieres hacernos creer que no eres un antivacunas.. Pero Joaquínin... Si piensas que una PCR da positivo por influenza, o que dan positivo con agua del grifo... Si piensas que hacerle una PCR a una persona que va a ingresar en un hospital.. no procede, y es para meterlos en la lista 🙄. Solo hay que leer tus comentarios para ya solo por eso.. "no tomarte en serio".
Encima por más que te expliquen con hechos.. No quieres entender porque no va con tu discurso, ni en cosas tan básicas como esas. ¡¡No te das cuenta que quedas en evidencia!!.
Si piensas que aquí estamos para amargarte la vida. ¿Que haces aquí repartiendo tu sabiduria?.
 No quieres entender que alguien que no entienda lo más mínimo de lo que estás hablando, y te crea.. Puede poner su vida en riesgo por hacerte caso. Para eso estamos algunos aquí, para poner datos y cosas verificadas y desmontar a personas como tú.. Yo ya perdí a demasiada gente en esta pandemia, y por eso mismo se en lo que estamos metidos. Y por más que tu pienses que es que queremos hacer el mal y somos unos comprados o pagados. Me da exactamente igual y seguiré poniendo datos verificables que desmonten todas las locuras que vais esparciendo.

